//index.js
//获取应用实例
const app = getApp()
var img = ''
// img = img.slice(0, 2048)

Page({
  data: {
    peopleList: [{
      id: 1,
      name: '张三'
    }, {
        id: 2,
        name: '李四'
    }],
    motto: 'Hello World',
    userInfo: {},
    ip: '192.168.1.113',
    hasUserInfo: false,
    canIUse: wx.canIUse('button.open-type.getUserInfo')
  },
  selectPhoto() {
    wx.chooseImage({
      count: 1,
      sizeType: ['original', 'compressed'],
      sourceType: ['album', 'camera'],
      success(res) {
        console.log(res)
        // tempFilePath可以作为img标签的src属性显示图片
        const tempFilePaths = res.tempFilePaths[0]

        wx.getFileSystemManager().readFile({
          filePath: tempFilePaths,
          encoding: 'hex',
          success: res => {
            //返回临时文件路径
            console.log(res)
          },
          fail: (errMsg) => {
            console.log(errMsg)
          }
        })
      }
    })
  },
  // ArrayBuffer转为字符串，参数为ArrayBuffer对象
  ab2str(buf) {
    return String.fromCharCode.apply(null, new Uint16Array(buf));
  },
  sendUdp(udp, test) {
    udp.send({
      address: this.data.ip,
      port: 6125,
      message: JSON.stringify(test)
    })
  },
  udpStart() {
    const udp = wx.createUDPSocket()
    let test = { func: "StartTransfer", imgcnt: 1, width: 320, heigh: 240, type: "RGB888" }
    let i = 0
    let pack = 0
    let buffseq = ''
    if (img.length % 1024 !== 0) {
      pack = Math.floor(img.length / 1024) + 1
    } else {
      pack = Math.floor(img.length / 1024)
    }
    console.log('包长度~~~' + pack)
    let interval = 0
    let interfunc = null

    udp.bind()
    udp.onListening(function (res) {
      console.log('监听中...')
      console.log(res)
    })
    this.sendUdp(udp, test)
    udp.onMessage((res) => {
      console.log(res)
      if (res.message) {
        let testStr = this.ab2str(res.message.data)
        let aa = JSON.parse(testStr)
        console.log(aa)
        if (aa.func === 'StartTransfer' && aa.status === 'ok') {
          console.log(img.length)
          let imgHead = { "func": "TransferImgHead", "imgseq": 1, "role": 0, "totalsize": img.length, "buffsize": 10240 }
          this.sendUdp(udp, imgHead)
        }
        if (aa.func === 'TransferImgHead' && aa.status === 'ok') {
          console.log('=====')
          let imgHead = { "func": "GetDeviceInfo", "timestamp": "202007202222" }
          this.sendUdp(udp, imgHead)
        }
        if (aa.func === 'GetDeviceInfo' && aa.status === 'ok') {
          console.log('88888')
          console.log('i是~~~~~' + i)
          interfunc = setInterval(() => {
            interval++
            console.log(interval)
            if (interval > 3) {
              console.log('.............................')
              interval = 0
              let resend = { "func": "BUFReSend", "id": parseInt(buffseq) + 1 }
              console.log(resend)
              this.sendUdp(udp, resend)
            }
          }, 1000)
          udp.send({
            address: this.data.ip,
            port: 6125,
            message: img.slice(0, 1024)
          })
        }
        if (aa.func === 'BUFReSend') {
          udp.send({
            address: this.data.ip,
            port: 6125,
            message: img.slice(i * 1024, (i + 1) * 1024)
          })
        }
        if (aa.func === 'Nextpic') {
          buffseq = aa.buffseq
          i++
          interval = 0
          udp.send({
            address: this.data.ip,
            port: 6125,
            message: img.slice(i * 1024, (i + 1) * 1024)
          })
        }
        if (aa.func === 'TransferImgEnd') {
          console.log('099767896789tg=============')
          clearInterval(interfunc)
        }
      }
    })
  },
  onLoad: function () {
    this.udpStart()
  }
})
